import {
  LOGIN_REQUEST,
  LOGIN_SUCCESS,
  INCORRECT_PASSWORD,
  USER_NOT_FOUND
} from "./Login.state";

const loginRequest = ()=>{
  return (dispatch)=>{
    dispatch({
      type: "message"
    })
  }
  return {
    type: "testing"
  }
}

export {
  loginRequest
}
